// src/App.js
import React, { useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { PizzaProvider, usePizza } from './context/PizzaContext';
import PizzaCard from './components/PizzaCard'; // Example component to display pizzas
import Home from './components/Home';
import AdminPanel from './components/AdminPanel';
import Login from './pages/Login';
import '@fortawesome/fontawesome-free/css/all.min.css';


const App = () => {
  return (
    <PizzaProvider>
      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/pizzaCard" element={<PizzaCard />} />
          <Route path="/login" element={<PizzaCard />} />

          <Route path="/AdminPannel" element={<AdminPanel />} />

          {/* Add more routes as needed */}
        </Routes>
      </Router>
    </PizzaProvider>
  );
};

export default App;
